import React, { Component } from 'react';
import { Button, Tab, Tabs } from '@blueprintjs/core';
import MainContainer from '../MainContainer/MainContainer';
//import '../NavBar/Navbar.css'
import './Sidebar.css';

export default class Sidebar extends Component {
   state = {
      activeTabID: 1
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });
   changeTab(id) {
      this.setState({ activeTabID: id });
   }
   render() {
      return (
         <div>
            {side_old()}
            <MainContainer>
               <Tabs id='1' onChange={this.handleTabChange} large>
                  <Tab id='1' panel={<div>1</div>} />
                  <Tab id='2' panel={<div>2</div>} />
                  <Tab id='3' panel={<div>3</div>} />
                  <Tab id='4' panel={<div>4</div>} />
               </Tabs>
            </MainContainer>
         </div>
      );
   }
}

const side_old = () => {
   return (
      <nav class='side-bar no-border'>
         <Button minimal large icon='home' fill></Button>
         <Button
            minimal
            large
            icon='dashboard'
            fill
            active
            intent='primary'
            onClick={this.handleTabChange(1)}
         ></Button>
         <Button minimal large icon='control' fill></Button>
         <Button minimal large icon='edit' fill></Button>
         <Button minimal large icon='locate' fill></Button>
      </nav>
   );
};
